import React from 'react';
import {Link} from 'react-router-dom';

const Header = () => {
    return (
        <div className={`ui secondary pointing menu`}>
            <Link to={`/blog/list`} className={`item`}>
                Blog Post
            </Link>
            <div>
                <span style={{textAlign: 'left'}}>
                    <Link to={`/blog/new`} className={`ui button primary`}>
                        Create Post
                    </Link>
                </span>
                <span style={{float: 'right'}}>
                    <Link to={`/blog/list`} className={`ui button primary`}>
                        Published Post
                    </Link>
                </span>
            </div>
        </div>
    )
};

export default Header;
